pragma solidity ^0.8.20;


interface IERC20 {
    function balanceOf(address account) external view returns (uint256);
    function transfer(address to, uint256 amount) external returns (bool);
}


abstract contract Ownable {
    address public owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    modifier onlyOwner() {
        require(msg.sender == owner, "not owner");
        _;
    }

    constructor() {
        owner = msg.sender;
        emit OwnershipTransferred(address(0), msg.sender);
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "zero address");
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }
}


contract Faucet is Ownable {
    IERC20 public immutable token;
    uint256 public constant FAUCET_AMOUNT = 100 * 1e6; 
    uint256 public constant COOLDOWN = 1 hours;

    mapping(address => uint256) public lastClaim;

    event Claimed(address indexed user, uint256 amount);

    constructor(address _token) {
        require(_token != address(0), "token addr zero");
        token = IERC20(_token);
    }

    function claim() external {
        uint256 last = lastClaim[msg.sender];
        require(block.timestamp - last >= COOLDOWN, "wait before next claim");

        require(
            token.balanceOf(address(this)) >= FAUCET_AMOUNT,
            "faucet empty"
        );

        lastClaim[msg.sender] = block.timestamp;

        require(token.transfer(msg.sender, FAUCET_AMOUNT), "transfer failed");

        emit Claimed(msg.sender, FAUCET_AMOUNT);
    }


    function withdraw(uint256 amount, address to) external onlyOwner {
        require(to != address(0), "zero addr");
        require(token.transfer(to, amount), "withdraw transfer failed");
    }
}

contracts/MockUSDC.sol.content:
pragma solidity ^0.8.20;


contract MockUSDC {
    string public name = "Mock USDC";
    string public symbol = "mUSDC";
    uint8 public constant decimals = 6;

    uint256 public totalSupply;

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    address public owner;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    modifier onlyOwner() {
        require(msg.sender == owner, "not owner");
        _;
    }

    constructor() {
        owner = msg.sender;

        _mint(msg.sender, 1_000_000 * 10**decimals);
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "zero address");
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }

    function _mint(address to, uint256 amount) internal {
        require(to != address(0), "mint to zero");
        totalSupply += amount;
        balanceOf[to] += amount;
        emit Transfer(address(0), to, amount);
    }


    function mint(address to, uint256 amount) external onlyOwner {
        _mint(to, amount);
    }

    function transfer(address to, uint256 amount) external returns (bool) {
        _transfer(msg.sender, to, amount);
        return true;
    }

    function approve(address spender, uint256 amount) external returns (bool) {
        allowance[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address from, address to, uint256 amount) external returns (bool) {
        uint256 allowed = allowance[from][msg.sender];
        require(allowed >= amount, "allowance");
        allowance[from][msg.sender] = allowed - amount;
        _transfer(from, to, amount);
        return true;
    }

    function _transfer(address from, address to, uint256 amount) internal {
        require(to != address(0), "to zero");
        uint256 bal = balanceOf[from];
        require(bal >= amount, "balance");
        balanceOf[from] = bal - amount;
        balanceOf[to] += amount;
        emit Transfer(from, to, amount);
    }
}

contracts/SavingsVault.sol.content:
pragma solidity ^0.8.20;


interface IERC20 {
    function balanceOf(address account) external view returns (uint256);
    function transfer(address to, uint256 amount) external returns (bool);
    function transferFrom(address from, address to, uint256 amount) external returns (bool);
}


abstract contract Ownable {
    address public owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    modifier onlyOwner() {
        require(msg.sender == owner, "not owner");
        _;
    }

    constructor() {
        owner = msg.sender;
        emit OwnershipTransferred(address(0), msg.sender);
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "zero address");
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }
}


contract SavingsVault is Ownable {
    IERC20 public immutable asset; 
    string public name;
    string public symbol;
    uint8 public constant decimals = 18; 

    uint256 public totalShares;
    mapping(address => uint256) public balanceOf;

    event Deposit(address indexed user, uint256 assets, uint256 shares);
    event Withdraw(address indexed user, uint256 assets, uint256 shares);
    event YieldInjected(address indexed from, uint256 newTotalAssets);

    constructor(address _asset, string memory _name, string memory _symbol) {
        require(_asset != address(0), "asset addr zero");
        asset = IERC20(_asset);
        name = _name;
        symbol = _symbol;
    }



    function totalAssets() public view returns (uint256) {
        return asset.balanceOf(address(this));
    }

    function convertToShares(uint256 assets) public view returns (uint256) {
        uint256 _totalShares = totalShares;
        uint256 _totalAssets = totalAssets();

        if (_totalShares == 0 || _totalAssets == 0) {
            return assets * 1e18; 
        } else {
            return (assets * _totalShares) / _totalAssets;
        }
    }

    function convertToAssets(uint256 shares) public view returns (uint256) {
        uint256 _totalShares = totalShares;
        uint256 _totalAssets = totalAssets();
        if (_totalShares == 0) return 0;
        return (shares * _totalAssets) / _totalShares;
    }



    function deposit(uint256 assets) external returns (uint256 shares) {
        require(assets > 0, "zero assets");

        shares = convertToShares(assets);
        require(shares > 0, "zero shares");


        require(asset.transferFrom(msg.sender, address(this), assets), "transferFrom failed");


        totalShares += shares;
        balanceOf[msg.sender] += shares;

        emit Deposit(msg.sender, assets, shares);
    }

    function withdraw(uint256 shares) external returns (uint256 assetsOut) {
        require(shares > 0, "zero shares");
        uint256 bal = balanceOf[msg.sender];
        require(bal >= shares, "insufficient shares");

        assetsOut = convertToAssets(shares);
        require(assetsOut > 0, "zero assets");


        balanceOf[msg.sender] = bal - shares;
        totalShares -= shares;


        require(asset.transfer(msg.sender, assetsOut), "transfer failed");

        emit Withdraw(msg.sender, assetsOut, shares);
    }

    function notifyYieldInjection() external onlyOwner {
        emit YieldInjected(msg.sender, totalAssets());
    }
}

